import React from "react";
import { Redirect, Switch } from "react-router-dom";
import { ContentRoute } from "../../../../_metronic/layout";
import { SalesPage } from "./SalesPage"
import { SalesBooking } from "./SalesBooking";
import { SalesBookingView } from "./view-page/SalesBookingView"
import { SalesData } from "./SalesData";
import { SalesOrder } from "./SalesOrder"
import { SalesOrderView } from "./SalesOrderView";

export function SalesRouting() {
  return (
    <Switch>
      <Redirect
        exact={true}
        from="/salescollection/sales"
        to="/salescollection/sales/list"
      />

      <ContentRoute
        path="/salescollection/sales/list"
        component={SalesPage}
      />
      <ContentRoute
        path="/salescollection/sales/slaes-booking"
        component={SalesBooking}
      />
      <ContentRoute
        path="/salescollection/sales/slaes-data"
        component={SalesData}
      />
      <ContentRoute
        path="/salescollection/sales/slaes-booking-view"
        component={SalesBookingView}
      />
      <ContentRoute
        path="/salescollection/sales/slaes-order"
        component={SalesOrder}
      />
      <ContentRoute
        path="/salescollection/sales/sales-order-view"
        component={SalesOrderView}
      />
    </Switch>
  );
}
